import axios from 'axios';
class AdminTicketClerkService {

    async getAll() {
        const response = await axios.get('/api/ticket-clerks');
        return response.data;
    }

    async getById(id) {
        const response = await axios.get(`/api/ticket-clerks/${id}`);
        return response.data;
    }

    async create(ticketClerk) {
        const response = await axios.post('/api/ticket-clerks', ticketClerk);
        return response.data;
    }

    async update(id, updatedClerk) {
        const response = await axios.put(`/api/ticket-clerks/${id}`, updatedClerk);
        return response.data;
    }

    async delete(id) {
        const response = await axios.delete(`/api/ticket-clerks/${id}`);
        return response.data;
    }
}

export default new AdminTicketClerkService();
